import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import './Profile.css';

interface ProfileData {
  profile: any;
  attendanceRecords: any[];
  statistics: {
    totalRecords: number;
    totalCheckIns: number;
    totalCheckOuts: number;
    lastPunch?: string;
  };
}

const Profile: React.FC = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const [profileData, setProfileData] = useState<ProfileData | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    fetchProfile();
  }, []);

  const fetchProfile = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');
      const response = await fetch(`${process.env.REACT_APP_API_URL}/profile/my-profile`, {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });

      if (!response.ok) {
        if (response.status === 401) {
          logout();
          return;
        }
        throw new Error('Failed to fetch profile');
      }

      const data = await response.json();
      setProfileData(data);
    } catch (err: any) {
      setError(err.message || 'Failed to load profile');
    } finally {
      setLoading(false);
    }
  };

  const handleExport = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch(`${process.env.REACT_APP_API_URL}/export/my-attendance`, {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });

      if (!response.ok) throw new Error('Export failed');

      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = `my_attendance_${new Date().toISOString().split('T')[0]}.xlsx`;
      document.body.appendChild(a);
      a.click();
      window.URL.revokeObjectURL(url);
      document.body.removeChild(a);
    } catch (error) {
      alert('Failed to export data');
    }
  };

  if (loading) {
    return (
      <div className="profile-loading">
        <div className="loading-spinner"></div>
        <p>Loading profile...</p>
      </div>
    );
  }

  if (error || !profileData) {
    return (
      <div className="profile-error">
        <h2>‚ö†Ô∏è Error</h2>
        <p>{error || 'Failed to load profile'}</p>
        <button onClick={() => navigate('/dashboard')}>Back to Dashboard</button>
      </div>
    );
  }

  const { profile, attendanceRecords, statistics } = profileData;

  return (
    <div className="profile">
      <div className="profile-header">
        <div className="header-content">
          <h1>My Profile</h1>
          <div className="header-actions">
            {(user?.role === 'admin' || user?.role === 'supervisor') && (
              <button onClick={() => navigate('/dashboard')} className="btn btn-primary">
                Dashboard
              </button>
            )}
            <button onClick={handleExport} className="btn btn-success">
              üìä Export My Data
            </button>
            <button onClick={logout} className="btn btn-secondary">
              Logout
            </button>
          </div>
        </div>
      </div>

      <div className="profile-content">
        <div className="profile-info-card">
          <h2>Employee Information</h2>
          <div className="info-grid">
            <div className="info-item">
              <label>Employee Code:</label>
              <span>{profile.Employee_Code}</span>
            </div>
            <div className="info-item">
              <label>Name (English):</label>
              <span>{profile.Employee_Name_1_English}</span>
            </div>
            <div className="info-item">
              <label>Name (Arabic):</label>
              <span>{profile.Employee_Name_1_Arabic}</span>
            </div>
            <div className="info-item">
              <label>Company:</label>
              <span>{profile.Company_Code}</span>
            </div>
            <div className="info-item">
              <label>Branch:</label>
              <span>{profile.Branch_Code}</span>
            </div>
            <div className="info-item">
              <label>Site:</label>
              <span>{profile.Site_1_English}</span>
            </div>
          </div>
        </div>

        <div className="statistics-card">
          <h2>Attendance Statistics</h2>
          <div className="stats-grid">
            <div className="stat-box">
              <div className="stat-number">{statistics.totalRecords}</div>
              <div className="stat-label">Total Records</div>
            </div>
            <div className="stat-box">
              <div className="stat-number">{statistics.totalCheckIns}</div>
              <div className="stat-label">Check-Ins</div>
            </div>
            <div className="stat-box">
              <div className="stat-number">{statistics.totalCheckOuts}</div>
              <div className="stat-label">Check-Outs</div>
            </div>
          </div>
          {statistics.lastPunch && (
            <div className="last-punch">
              <strong>Last Punch:</strong> {new Date(statistics.lastPunch).toLocaleString()}
            </div>
          )}
        </div>

        <div className="attendance-card">
          <h2>Recent Attendance Records</h2>
          <div className="attendance-table">
            {attendanceRecords.length > 0 ? (
              <table>
                <thead>
                  <tr>
                    <th>Date & Time</th>
                    <th>Type</th>
                    <th>Clock ID</th>
                  </tr>
                </thead>
                <tbody>
                  {attendanceRecords.slice(0, 20).map((record, index) => (
                    <tr key={index}>
                      <td>{new Date(record.punch_time).toLocaleString()}</td>
                      <td>
                        {record.InOutMode === 0 ? (
                          <span className="badge badge-in">IN</span>
                        ) : (
                          <span className="badge badge-out">OUT</span>
                        )}
                      </td>
                      <td>{record.clock_id}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            ) : (
              <p className="no-records">No attendance records found.</p>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
